const App = () => {
  console.log("Hello from App Component");
  const date = new Date();
  const a = 10;
  const b = 11;
  return (
    <div>
      <h1>{date.toString()}</h1>
      <h1>
        {" "}
        {a} + {b} is {a + b}
        <Hello />
      </h1>
    </div>
  );
};

const Hello = () => {
  return (
    <div>
      <h1>woah!!</h1>
    </div>
  );
};

export default App;
